            s2d_l2_dflt_child_l3_child_res_valid =  1'b1;
            s2d_l2_dflt_child_l3_child_res_data[7] = 1'b1;
          end
        end
      default:
        s8_state_next = 3'h0;
    endcase
  end
  
  //------- reg assigns for serial8 i/f
