      pio_dec_write_cgate_dly1 <= #1  1'b0;
      pio_dec_read_cgate_dly2 <= #1  1'b0;
      pio_dec_write_cgate_dly2 <= #1  1'b0;
      pio_dec_read_cgate_dly3 <= #1  1'b0;
      pio_dec_write_cgate_dly3 <= #1  1'b0;
      pio_dec_read_cgate_dly4 <= #1  1'b0;
