      pio_dec_write_cgate_dly5 <= #1 (pio_dec_write_cgate_dly4 & !pio_dec_write_cgate_dly5) | (pio_dec_write_cgate_dly5 & !(pio_dec_write_cgate_dly1 & !(s8_pio_dec_write)));
